String.prototype.replaceAll = function (target, replacement, insensitive) {
	if (insensitive) {
		return this.replace(new RegExp(target.replace(/[\\\^\$\.\[\]\|\(\)\?\*\+\{\}\-]/g, ""), "gi"), replacement);
	} else {
		return this.split(target).join(replacement);
	}
};

