var f = 0;

var fastWalk = {
	name: "FastWalk",
	desc: "Makes you walk faster.",
	category: VertexClientPE.category.MOVEMENT,
	type: "Mod",
	state: false,
	count: 0,
	isStateMod: function() {
		return true;
	},
	onToggle: function() {
		this.state = !this.state;
		f = this.state?1:0;
	},
	onTick: function() {
		if(f == 1) {
            Xpos = getPlayerX();
            Zpos = getPlayerZ();
            f = f + 1;
        } else if(f == 3) {
            f = 1;
            Xdiff = getPlayerX() - Xpos;
            Zdiff = getPlayerZ() - Zpos;
            setVelX(getPlayerEnt(), Xdiff);
            setVelZ(getPlayerEnt(), Zdiff);
            Xdiff = 0;
            Zdiff = 0;
        }
        if(f != 1) {
            f = f + 1;
        }
	}
}

var bowAimbot = {
	name: "BowAimbot",
	desc: "Makes shot arrows get to the closest entity.",
	category: VertexClientPE.category.COMBAT,
	type: "Mod",
	state: false,
	isStateMod: function() {
		return true;
	},
	onToggle: function() {
		this.state = !this.state;
	},
	onEntityAdded: function(e) {
		var mobs = Entity.getAll();
		for(var i = 0; i < mobs.length; i++) {
			var ent = mobs[i];
			var x = Entity.getX(ent) - Entity.getX(getPlayerEnt());
			var z = Entity.getZ(ent) - Entity.getZ(getPlayerEnt());
			if(Entity.getEntityTypeId(ent) != EntityType.ITEM && Entity.getEntityTypeId(ent) != EntityType.ARROW && ent != getPlayerEnt()) {
				setVelX(e, x / 4.5);
				setVelY(e, 0);
				setVelZ(e, z / 4.5);
				break;
			}
		}
	}
}

