VertexClientPE.getHighestBlockDifference = function() {
	var x = getPlayerX();
	var y = getPlayerY();
	var z = getPlayerZ();
	while(getTile(x, y, z) == 0) {
		y--;
	} if(getTile(x, y, z) != 0) {
		return getPlayerY() - 2 - y;
	}
}

