function blockEventHook(x, y, z, e, d) {
	if(VertexClientPE.isDevMode()) {
		if(d == 1) {
			isChestOpen = true;
			if(chestUI == null || !chestUI.isShowing()) {
				VertexClientPE.showChestUI(x, y, z);
			}
		} if(d == 0) {
			isChestOpen = false;
			if(chestUI != null) {
				VertexClientPE.hideChestUI();
			}
			if(hasPushed) {
				VertexClientPE.stealChestContent(x, y, z);
			}
		}
	}
}
 
